create table BPS_BANK
(
    BANK_ID                        NUMBER(19)   not null
        constraint BPS_BANK_ID_PK
            primary key,
    BANK_NAME                      VARCHAR2(64) not null,
    BANK_CODE                      VARCHAR2(32) not null,
    BANK_ABBREVIATION              VARCHAR2(32) not null,
    DISPLAY_NAME                   VARCHAR2(32) not null,
    SORTING                        NUMBER(8)    not null,
    VERSION                        NUMBER(8),
    CREATE_TIME                    TIMESTAMP(6),
    UPDATE_TIME                    TIMESTAMP(6),
    PAYMENT_TERM                   VARCHAR2(32),
    PROVIDER                       VARCHAR2(32),
    MOBILE_SORTING                 NUMBER(8),
    DAILY_AMOUNT_LIMIT_PARAMETER   VARCHAR2(64),
    OPERATION_TYPE                 VARCHAR2(64),
    DISPLAY_STATUS                 VARCHAR2(32),
    DEPOSIT_MIN_AMOUNT             NUMBER(9, 2),
    DEPOSIT_MAX_AMOUNT             NUMBER(9, 2),
    VIP_DEPOSIT_MIN_AMOUNT         NUMBER(9, 2),
    VIP_DEPOSIT_MAX_AMOUNT         NUMBER(9, 2),
    CT_DEPOSIT_DURATION_STATISTIC  NUMBER(6),
    CT_DEPOSIT_NON_ARRIVAL_COUNT   NUMBER(6),
    CT_DEPOSIT_CHANNEL_FREEZE_TIME NUMBER(6),
    IP_DEPOSIT_DURATION_STATISTIC  NUMBER(6),
    IP_DEPOSIT_NON_ARRIVAL_COUNT   NUMBER(6),
    IP_DEPOSIT_CHANNEL_FREEZE_TIME NUMBER(6),
    DEPOSIT_SELECTIONS_COMBINE     VARCHAR2(255),
    TEMPLATE_NAME                  VARCHAR2(128),
    ICON_NAME                      VARCHAR2(128),
    HINT_NAME                      VARCHAR2(128),
    WEB_STATUS                     VARCHAR2(32),
    IOS_STATUS                     VARCHAR2(32),
    ANDROID_STATUS                 VARCHAR2(32)
)
/

comment on column BPS_BANK.BANK_ID is 'ID'
/

comment on column BPS_BANK.BANK_NAME is '銀行名稱'
/

comment on column BPS_BANK.BANK_CODE is '銀行編號，第三方參數用。'
/

comment on column BPS_BANK.BANK_ABBREVIATION is '銀行縮寫，平台查詢用。'
/

comment on column BPS_BANK.DISPLAY_NAME is 'I18N 顯示名稱'
/

comment on column BPS_BANK.SORTING is '排序'
/

comment on column BPS_BANK.PAYMENT_TERM is '銀行在前後台顯示類型'
/

comment on column BPS_BANK.PROVIDER is '渠道商'
/

comment on column BPS_BANK.MOBILE_SORTING is '手機排序'
/

comment on column BPS_BANK.DAILY_AMOUNT_LIMIT_PARAMETER is '充值每日上限類型(充提金额设置)'
/

comment on column BPS_BANK.OPERATION_TYPE is '前台收銀台類型'
/

comment on column BPS_BANK.DISPLAY_STATUS is '渠道顯示地方:NONE/FRONTEND_BACKEND/FRONTEND_BACKEND_OFFLINE/OFFLINE(線下充值)'
/

comment on column BPS_BANK.DEPOSIT_MIN_AMOUNT is '充值最低單筆充值金額'
/

comment on column BPS_BANK.DEPOSIT_MAX_AMOUNT is '充值最高單筆充值金額'
/

comment on column BPS_BANK.VIP_DEPOSIT_MIN_AMOUNT is 'VIP充值最低單筆充值金額'
/

comment on column BPS_BANK.VIP_DEPOSIT_MAX_AMOUNT is 'VIP充值最高單筆充值金額'
/

comment on column BPS_BANK.CT_DEPOSIT_DURATION_STATISTIC is '連續充值統計時間(秒)：X'
/

comment on column BPS_BANK.CT_DEPOSIT_NON_ARRIVAL_COUNT is '充值連續未到賬次數：Y'
/

comment on column BPS_BANK.CT_DEPOSIT_CHANNEL_FREEZE_TIME is '凍結渠道充值時間(秒)：Z'
/

comment on column BPS_BANK.IP_DEPOSIT_DURATION_STATISTIC is '連續充值統計時間(秒)：A'
/

comment on column BPS_BANK.IP_DEPOSIT_NON_ARRIVAL_COUNT is '充值連續未到賬次數：B'
/

comment on column BPS_BANK.IP_DEPOSIT_CHANNEL_FREEZE_TIME is '凍結渠道充值時間(秒)：C'
/

comment on column BPS_BANK.DEPOSIT_SELECTIONS_COMBINE is '充值：固定金額：逗號分割'
/

comment on column BPS_BANK.TEMPLATE_NAME is '模板名稱'
/

comment on column BPS_BANK.ICON_NAME is 'ICON名稱'
/

comment on column BPS_BANK.HINT_NAME is 'HINT名稱'
/

comment on column BPS_BANK.WEB_STATUS is 'WEB開關'
/

comment on column BPS_BANK.IOS_STATUS is 'IOS開關'
/

comment on column BPS_BANK.ANDROID_STATUS is 'ANDROID開關'
/

